    [],nt"revision_timestamp": "2016-08-04T07:11:21.881996",nt"name": "final-critical-habitat-for-7-musselsadeec",nt"isopen":
    false,nt"url": null,nt"notes": "These data identify, in general, the areas
    of final critical habitat for the endangered Amblema neislerii (fat threeridge),
    Lampsilis subangulata (shinyrayed pocketbook), Medionidus penicillatus (Gulf moccasinshell),
    Medionidus simpsonianus (Ochlockonee moccasinshell), Pleurobema pyriforme (oval
    pigtoe), and the threatened Elliptio chipolaensis (Chipola slabshell), and Elliptoideus
    sloatianus (purple bankclimber). These species are collectively referred to as the
    seven mussels..",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
